import React from 'react';
import { Table } from 'semantic-ui-react';

const PhoneList = props => {
	const shortNumbers = props.shortNumbers.map(shortNumber => {
		return (
			<Table.Row>
				<Table.Cell>{shortNumber.id}</Table.Cell>
				<Table.Cell>{shortNumber.number}</Table.Cell>
				<Table.Cell textAlign='center'><button class="ui icon button"><i aria-hidden="true" class="pencil alternate icon"></i></button></Table.Cell>
				<Table.Cell textAlign='center'><button class="ui icon button"><i aria-hidden="true" class="trash alternate icon"></i></button></Table.Cell>
				<Table.Cell textAlign='center'>{shortNumber.short_number}</Table.Cell>
				<Table.Cell textAlign='center'>{shortNumber.short_number !== undefined ? <button class="ui icon button"><i aria-hidden="true" class="pencil alternate icon"></i></button> : null}</Table.Cell>
				<Table.Cell textAlign='center' >{shortNumber.short_number !== undefined ? <button class="ui icon button"><i aria-hidden="true" class="trash alternate icon"></i></button> : null}</Table.Cell>
			</Table.Row>
		);
	});

	//celled
	//collapsing
	return (
		<Table celled structured> 
			<Table.Header>
				<Table.Row>
					<Table.HeaderCell>Id</Table.HeaderCell>
					<Table.HeaderCell textAlign='center' colSpan='3'>Public Number</Table.HeaderCell>
					<Table.HeaderCell textAlign='center' colSpan='3'>Short Number</Table.HeaderCell>
				</Table.Row>
			</Table.Header>
			<Table.Body>
				{shortNumbers}
			</Table.Body>
		</Table>
	);
};

export default PhoneList;



